import react, {useState} from "react";
import styles from './index.css';

const CheckBox = () =>{
    let task = [
        {
            id:1,
            name: 'abc',
            check: false
        },
        {
            id:2,
            name: 'def',
            check: true
        }
    ]

    const handleCheck = (el) => {
        task[el].check = !task[el].check;
    }

    return(
        <div className="CheckBoxContainer">
            {task.map((el)=>(
                <form className="CheckBox">
                    <input type="checkbox" checked={el.check} onChange={handleCheck(el)}/>
                    <p>{el.name}</p>
                    <input type="button" value="delete"/>
                </form>
            ))}
        </div>
    )
} 
export default CheckBox;
